import React, { Component } from 'react';
import './App.css';



import {Layout, Header, Navigation, Content, Drawer} from 'react-mdl'
import {Link } from 'react-router-dom';
import Main from './components/Main';





class App extends Component {
  render() {
    return (


    <div className="big-content">

    <Layout>
      <Header className="header-color" title ="FSU" scroll>
        <Navigation>
          <Link to="/BikeDistribution">Bike Distribution</Link>
          <Link to="/CoatDistribution">Coat Distribution</Link>
          <Link to="/TyreDistribution">Tyre Distribution</Link>
          <Link to="/TyreDistribution">Reports</Link>
        </Navigation>
      </Header>
      <Drawer title="Menu">
        <Navigation>
          <Link to="/BikeDistribution">Projects</Link>
          <Link to="/CoatDistribution">Districts</Link>
          <Link to="/TyreDistribution">Distribution Charts</Link>
          <Link to="/TyreDistribution">Settings</Link>

        </Navigation>
      </Drawer>
      <Content>
        <div className ="Page-Content"/>
        <Main />
      </Content>
    </Layout>






    </div>

    );
  }
}

export default App;
